import React, { useState } from "react";
import { userDetails } from "./user_details";

const Login = () => {
  const [login, setLogin] = useState({
    email: '',
    password: '',
  });

  const loginInput = (e) =>{
    let name = e.target.name;
    let value = e.target.value;
  }
  return (
    <React.Fragment>
        <input name='email' type='email' onChange={loginInput} value={login.email}/>
        <input name='pwd' type='password' onChange={loginInput}  value={login.pwd}/>
      
    </React.Fragment>
  );
};

export default Login;
